import React from 'react';
import Layout from '../Layout/Layout';

const Index: React.FC = () => {
    return (
        <Layout page="Home">
            <h3>This is a project provided from FRMWRK and the goal is to build an environment on how to build universal web component.</h3>
        </Layout>
    )
};

export default Index;
